    "protocol": "Tissue samples for RNA extraction were collected in parallel to previously reported ChIP samples {Villar, 2015}. Small pieces of liver tissue (typically 0.5-2 cubic cms) were snap-frozen in dry-ice or liquid nitrogen and stored at -80C. Cetacean liver samples were typically bigger frozen blocks, and for these RNA extraction was conducted on tissue pieces cut from the central section of the frozen piece, to maximise RNA quality. Total RNA was extracted from snap-frozen liver tissue with RNAeasy Mini Kit (Qiagen). 20 mg of tissue were weighed on dry-ice and immediately homogenized in 600 microliters of RLT buffer containing 10 microliters of beta-mercaptoethanol per mililiter of buffer. Tissue samples were homogenized in a Precellys 24 tissue homogenizer, using settings 5500-2x15-015 and Precellys tubes CK28-R (bertin technology). Liver homogenates were processed according to manufacturers' instructions (Qiagen RNAeasy Mini Kit) and total RNA eluted in 50ul RNAse-free water. 10ug total RNA from each sample were treated with 4 units of Turbo DNase (Ambion AM1907), and total RNA samples were run on an Agilent Bioanalyser (RNA nano chip, Agilent) to check RNA integrity (samples were taken forward if RIN values were above 7). Ribosomal RNA was depleted with Ribo-Zero rRNA removal kit (Epicentre RZC110424) as per instructions from the manufacturer, using 5 ug of DNase-treated total RNA.  Strand-specific RNA-depleted RNA-Seq libraries were prepared with a modified version of TruSeq RNA Library Preparation kit (Illumina). Fragmentation and first-strand synthesis of rRNA-depleted RNA samples were according to the Illumina protocol. Second-strand cDNA synthesis was done with SuperScript double-stranded cDNA synthesis kit (Life Technologies) at 16C for two hours, using a 10mM dATP, dCTP, dGTP, dUTP nucleotide mix. cDNA was purified with QIAquick PCR purification kit (Qiagen) and end repair, A-tailing and adaptor ligation were performed with Illumina's protocol. Second-strand degradation was done by treatment with one unit of Uracil N-Glycosylase (Life Technologies) at 35C for 15 minutes, prior to PCR enrichment. Libraries were amplified according to Illumina's protocol for 13 PCR cycles, and cleaned-up with Agencourt AMPure beads (Beckman Coulter) with a 1:1 DNA:beads ratio."
